        <div className="banner-text">
          <h1>Welcome to Financial Portfolio Manager!</h1>
          <p>Manage and track your financial assets in one place.</p>
        </div>
      </div>
      <div className="section">
        <h2>Market Overview</h2>
        <p>Get insights into market trends and make informed investment decisions.</p>
        {/* Other content, such as images or additional text, can be added here */}
      </div>
      {/* Add additional sections as needed */}
    </div>
  );
}

export default Home;
